import React from 'react';

const AdminPage = () => {
  return (
    <div className="admin-page">
      <div className="container">
        <h1>Admin Dashboard</h1>
        <p>Welcome to the admin dashboard.</p>
      </div>
    </div>
  );
};

export default AdminPage;
